import React from 'react'
import { Button } from 'reactstrap';

const btnhandle = () => {
    toast("hello world")
}

function Header({ title }) {
    return (
        <div>
            <h1>This is {title}</h1>
            <Button onClick={btnhandle} outline color="success">Succes</Button>
        </div>
    )
}

export default Header
